  input: TEXT,F3XA,,"In response to your letter requesting information regarding the
    committee's best efforts to obtain the full name, mailing address, occupation
    and employer for each contributor whose aggregate contributions exceed $200 in
    a calendar year, following please find our procedure.  The original solicitation
    includes a clear and conspicuous request for the contributor information.  If
    the contributor does not include the information, a follow-up request is made
    which does not include a solicitation.  The second request occurs within 30 days
    of the contribution.  That request includes a pre-stamped, pre-addressed envelope.  If
    that information is then provided, the committee will amend our filing to include
    the additional information.  If you have any questions please contact me at 202/479-7042."
